A Modern Tale Of Boy Meets Girl Meets Girl!Voila [wah-lah... as if by magic]Oh The Tangled Beds We Weave... Liz and her husband Tony are longtime lovers, looking for a little excitement to heighten their passion. They find it in the form of beautiful Voila, with whom they have a climactic 3-way. But the real climax comes when Liz leaves poor Tony for her. A year later Voila is back, not Liz, and she tells Tony that Liz intends to return, but that Tony must reject her because she is her only true love. Will Tony respect the wishes of the woman who stole his wife? Or is something else at play here... a slight of hand... a bit of dark magic that eludes even Voila? B. Skow presents his debut boy/girl effort for Girlfriends Films, filled with his trademark brand of incredible sex, plus the sensuality and authenticity you expect from Girlfriends. The result? Voila! A joining of story and sexuality you won't soon forget!
